as owner','A UserAccount that this resource is owned by.'),(193,'en','has space','A data Space which this resource is a part of.'),(194,'en','id','An identifier of a SIOC concept instance. For example, a user ID. Must be unique for instances of each type of SIOC concept within the same site.'),(195,'en','ip address','The IP address used when creating this Item, UserAccount, etc. This can be associated with a creator. Some wiki articles list the IP addresses for the creator or modifiers when the usernames are absent.'),(196,'en','last activity date','The date and time of the last activity associated with a SIOC concept instance, and expressed in ISO 8601 format. This could be due to a reply Post or Comment, a modification to an Item, etc.'),(197,'en','last reply date','The date and time of the last reply Post or Comment, which could be associated with a starter Item or Post or with a Thread, and expressed in ISO 8601 format.'),(198,'en','name','The name of a SIOC concept instance, e.g. a username for a UserAccount, group name for a Usergroup, etc.'),(199,'en','note','A note associated with this resource, for example, if it has been edited by a UserAccount.'),(200,'en','num authors','The number of unique authors (UserAccounts and unregistered posters) who have contributed to this Item, Thread, Post, etc.'),(201,'en','num replies','The number of replies that this Item, Thread, Post, etc. has. Useful for when the reply structure is absent.'),(202,'en','num views','The number of times this Item, Thread, UserAccount profile, etc. has been viewed.'),(203,'en','scope of','A Role that has a scope of this resource.'),(204,'en','links to','Links extracted from hyperlinks within a SIOC concept, e.g. Post or Site.'),(205,'en','topic','A topic of interest, linking to the appropriate URI, e.g. in the Open Directory Project or of a SKOS category.'),(209,'en','related to','Related resources for this resource, e.g. for Posts, perhaps determined implicitly from topics or references.'),(213,'en','group of',NULL),(214,'en','has group',NULL),(215,'en','has part','An resource that is a part of this subject.'),(216,'en','part of','A resource that the subject is a part of.'),(220,'en','feed','A feed (e.g. RSS, Atom, etc.) pertaining to this resource (e.g. for a Forum, Site, UserAccount, etc.).'),(221,'en','likes','Used to indicate some form of endorsement by a UserAccount or Agent of an Item, Container, Space, UserAccount, etc.'),(222,'en','link','A URI of a document which contains this SIOC object.'),(223,'en','Ordered Collection','An ordered collection of concepts, where both the grouping and the ordering are meaningful.'),(224,'en','Collection','A meaningful collection of concepts.'),(225,'en','Concept Scheme','A set of concepts, optionally including statements about semantic relationships between those concepts.'),(226,'en','Concept','An idea or notion; a unit of thought.'),(228,'en','is in scheme','Relates a resource (for example a concept) to a concept scheme in which it is included.'),(229,'en','has top concept','Relates, by convention, a concept scheme to a concept which is topmost in the broader/narrower concept hierarchies for that scheme, providing an entry point to these hierarchies.'),(230,'en','is top concept in scheme','Relates a concept to the concept scheme that it is a top level concept of.'),(231,'en','preferred label','skos:prefLabel, skos:altLabel and skos:hiddenLabel are pairwise\n      disjoint properties.'),(232,'en','alternative label','skos:prefLabel, skos:altLabel and skos:hiddenLabel are pairwise disjoint properties.'),(233,'en','hidden label','skos:prefLabel, skos:altLabel and skos:hiddenLabel are pairwise disjoint properties.'),(234,'en','notation','A notation, also known as classification code, is a string of characters such as \"T58.5\" or \"303.4833\" used to uniquely identify a concept within the scope of a given concept scheme.'),(235,'en','note','A general note, for any purpose.'),(236,'en','change note','A note about a modification to a concept.'),(237,'en','definition','A statement or formal explanation of the meaning of a concept.'),(238,'en','editorial note','A note for an editor, translator or maintainer of the vocabulary.'),(239,'en','example','An example of the use of a concept.'),(240,'en','history note','A note about the past state/use/meaning of a concept.'),(241,'en','scope note','A note that helps to clarify the meaning and/or the use of a concept.'),(242,'en','is in semantic relation with','Links a concept to a concept related by meaning.'),(243,'en','has broader','Broader concepts are typically rendered as parents in a concept hierarchy (tree).'),(244,'en','has narrower','Narrower concepts are typically rendered as children in a concept hierarchy (tree).'),(245,'en','has related','skos:related is disjoint with skos:broaderTransitive'),(246,'en','has broader transitive',NULL),(246,'und',NULL,'skos:broaderTransitive is a transitive superproperty of skos:broader.'),(247,'en','has narrower transitive',NULL),(247,'und',NULL,'skos:narrowerTransitive is a transitive superproperty of skos:narrower.'),(248,'en','has member','Relates a collection to one of its members.'),(249,'en','has member list','For any resource, every item in the list given as the value of the\n      skos:memberList property is also a value of the skos:member property.'),(250,'en','is in mapping relation with','These concept mapping relations mirror semantic relations, and the data model defined below is similar (with the exception of skos:exactMatch) to the data model defined for semantic relations. A distinct vocabulary is provided for concept mapping relations, to provide a convenient way to differentiate links within a concept scheme from links between concept schemes. However, this pattern of usage is not a formal requirement of the SKOS data model, and relies on informal definitions of best practice.'),(251,'en','has broader match','skos:broadMatch is used to state a hierarchical mapping link between two conceptual resources in different concept schemes.'),(252,'en','has narrower match','skos:narrowMatch is used to state a hierarchical mapping link between two conceptual resources in different concept schemes.'),(253,'en','has related match','skos:relatedMatch is used to state an associative mapping link between two conceptual resources in different concept schemes.'),(254,'en','has exact match','skos:exactMatch is disjoint with each of the properties skos:broadMatch and skos:relatedMatch.'),(255,'en','has close match','skos:closeMatch is used to link two concepts that are sufficiently similar that they can be used interchangeably in some information retrieval applications. In order to avoid the possibility of \"compound errors\" when combining mappings across more than two concept schemes, skos:closeMatch is not declared to be a transitive property.');
