INSERT INTO `rdfx_vocabulary_details` VALUES (3,'und','Friend of a Friend (FOAF) vocabulary','The Friend of a Friend (FOAF) RDF vocabulary, described using W3C RDF Schema and the Web Ontology Language.'),(5,'und','The RDF Schema vocabulary (RDFS)',NULL),(6,'en','SIOC Core Ontology Namespace','SIOC (Semantically-Interlinked Online Communities) is an ontology for describing the information in online communities. \nThis information can be used to export information from online communities and to link them together. The scope of the application areas that SIOC can be used for includes (and is not limited to) weblogs, message boards, mailing lists and chat channels.');
